import React from "react";
import "./VideoTracker.css"; // Assurez-vous que le chemin est correct

function VideoTracker() {
  return (
    <div className="video-tracker">
      <header className="tracker-header">
        {/* Ici, vous pouvez ajouter des boutons ou des titres comme "Take Tour", etc. */}
      </header>

      <div className="tracker-content">
        <div className="tracker-controls">
          {/* Ici, vous pouvez ajouter des champs de recherche et des boutons comme "Start Tracking", etc. */}
        </div>

        <div className="tracker-table">
          {/* Ici, vous pouvez ajouter une liste ou un tableau avec les éléments de suivi */}
        </div>
      </div>
    </div>
  );
}

export default VideoTracker;
